public class Solution {
    public IList<int> GoodSubsetofBinaryMatrix(int[][] grid) {
        int m = grid.Length, n = grid[0].Length;
        for (int mask = 1; mask < (1 << m); mask++) {
            List<int> subset = new List<int>();
            int[] columnSum = new int[n];
            int rowsCount = 0;
            for (int i = 0; i < m; i++) {
                if ((mask & (1 << i)) != 0) {
                    subset.Add(i);
                    rowsCount++;
                    for (int j = 0; j < n; j++) {
                        columnSum[j] += grid[i][j];
                    }
                }
            }
            bool isGoodSubset = true;
            foreach (int sum in columnSum) {
                if (sum > rowsCount / 2) {
                    isGoodSubset = false;
                    break;
                }
            }
            if (isGoodSubset) {
                return subset;
            }
        }
        return new List<int>();
    }
}
